function showHideToggle(id,type)
{
		var style = document.getElementById(id).style.display;
		if(style == 'none') showHide(id,type,'block');
		else showHide(id,type,'none');
}
function showHide(id,type,state)
{
        if (state == undefined) state = 'block';
		var style = document.getElementById(id).style.display;
		document.getElementById(id).style.display=""+state;
}
function getSelectValues(select) 
{
	var result = [];
	var options = select && select.options;
	var opt;
	
	for (var i=0, iLen=options.length; i<iLen; i++) 
	{
		opt = options[i];
		
		if (opt.selected) 
		{
		  result.push(opt.value || opt.text);
		}
	}
	return result;
}
function ajaxFunction(n,form,item)
{
  var xmlHttp;
  var url;
  try
  {  // Firefox, Opera 8.0+, Safari  
	  xmlHttp=new XMLHttpRequest();  
  }
  catch (e)
  {  // Internet Explorer  
    try
    {    
		xmlHttp=new ActiveXObject("Msxml2.XMLHTTP");    
	}
	catch (e)
    {    
		try
		{      
			xmlHttp=new ActiveXObject("Microsoft.XMLHTTP");      
		}
		catch (e)
      	{	      
			alert("Your browser does not support AJAX!");      
			return false;      
		}    
	}
  }
	xmlHttp.onreadystatechange=function()
	{
//alert(xmlHttp.readyState);
	  if(xmlHttp.readyState==4)
	  {
 		  response = xmlHttp.responseText;
		  if (n == 1) // KML
		  {
//alert('n = ' + n + ' response = ' + response);
			document.getElementById("kml").innerHTML = response;
			showHide("kml", "block");
		  }
		  if (n == 2) // KML
		  {
//alert('n = ' + n + ' response = ' + response);
			document.getElementById("kml").innerHTML = response;
			showHide("kml", "block");
		  }
	  }
	}
	if (n == 1) // KML
	{
		var times = []; // Select multiple times
		for ( var i = 0; i < form.time.selectedOptions.length; i++) 
		{
			times[i] = form.time.selectedOptions[i].value;
		}
		var bbox = form.bbox.value.replace(/ /g, '');
		bbox = bbox.split(",");
		pquery = 
		"&layer=" + form.layer.value +
		"&region=" + form.region.value +
		"&west=" + bbox[0] +
		"&south=" + bbox[1] +
		"&east=" + bbox[2] +
		"&north=" + bbox[3] +
		"&time=" + times;
		pquery = escape(pquery);
		pquery = pquery.replace("+","%2B");
		var ran_number= Math.random()*5000;
		url = cgi + "?GEOGLAM+" + ran_number + "+" + pquery;
	}
	if (n == 2) // KML for DEA
	{
		var times = []; // Select multiple times
		for ( var i = 0; i < form.time.selectedOptions.length; i++) 
		{
			times[i] = form.time.selectedOptions[i].value;
		}
		create_tiles = "";
		if (form.create_tiles.checked) { create_tiles = "create_tiles"; } 
		var bbox = form.bbox.value.replace(/ /g, '');
		pquery = 
		"&layer=" + form.layer.value +
		"&region=" + form.region.value +
		"&bbox=" + bbox +
		"&resolution=" + form.resolution.value +
		"&create_tiles=" + create_tiles +
		"&time=" + times;
		pquery = escape(pquery);
		pquery = pquery.replace("+","%2B");
		var ran_number= Math.random()*5000;
		url = cgi + "?DEA+" + ran_number + "+" + pquery;
	}
//alert('n = ' + n + ' url = ' + url);	
//return;
	if (url)
	{
		xmlHttp.open("GET",url,true);
		xmlHttp.send(null);  
	}
	else
	{
		return;
	}
}

